import React from "react";
import styles from "./Logo.module.css";

const Logo = () => {
  return (
    <img
      src="https://cdn.builder.io/api/v1/image/assets/TEMP/f99e3214613e86250718ad2ff42b9e4ccab52c20b2f9005efaabacd8583b8301?placeholderIfAbsent=true&apiKey=eaed1ddc95b0480bae09257e9297624a"
      alt="Company Logo"
      className={styles.logo}
    />
  );
};

export default Logo;
